public class CustomSessionStateModule : IHttpModule\n{\n    public void Init(HttpApplication context)\n    {\n        context.SessionEnd += new EventHandler(Session_End);\n    }\n\n    public void Dispose()\n    {\n    }\n\n    private void Session_End(object sender, EventArgs e)\n    {\n        // Access the session state here to clean up resources.\n        var sessionObj = HttpContext.Current.Session["YourSessionKey"] as IDisposable;\n        if (sessionObj != null)\n        {\n            sessionObj.Dispose();\n        }\n    }\n}